import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';

const products = [
  {
    id: 1,
    title: "Nawabi Couture Women's Office Bag",
    price: "₹ 1,499.00",
    image: "https://zouk.co.in/cdn/shop/files/Nawabi_Couture_Women_s_Office_Bag.jpg?v=1719318323&width=1000"
  },
  {
    id: 2,
    title: "Bella Vita Leather Handbag",
    price: "₹ 1,599.00",
    image: "https://zouk.co.in/cdn/shop/files/Nawabi_Couture_Women_s_Office_Bag.jpg?v=1719318323&width=1000"
  },
  {
    id: 3,
    title: "Zouk Men's Travel Bag",
    price: "₹ 999.00",
    image: "https://zouk.co.in/cdn/shop/files/Nawabi_Couture_Women_s_Office_Bag.jpg?v=1719318323&width=1000"
  }
]

const App = () => {
  return (
    <div>
      <Navbar />
      <Carousel />
      <ProductList products={products} />
      <Footer />
    </div>
  );
};

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">BAGS</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="#">LAUGGAGE</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">FOOTWEARS</a>
            </li>
            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                COLLECTION
              </a>
              <ul className="dropdown-menu">
                <li><a className="dropdown-item" href="#">OFFERS</a></li>
                <li><a className="dropdown-item" href="#">HAND BAGS </a></li>
                <li><hr className="dropdown-divider" />OFFICE BAGS</li>
                <li><a className="dropdown-item" href="#">Something else here</a></li>
              </ul>
            </li>
            <li className="nav-item">
              <a className="nav-link disabled" aria-disabled="true">NEW ARRIVALS</a>
            </li>
          </ul>
          <form className="d-flex" role="search">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </div>
    </nav>
  );
};

const Carousel = () => {
  return (
    <div id="carouselExample" className="carousel slide">
      <div className="carousel-inner">
        <div className="carousel-item active">
          <img src="https://zouk.co.in/cdn/shop/collections/footwear_banner-01_f8866ce7-274b-4f2f-95f3-73579e529f70.png?v=1718950005&width=2000" className="d-block w-100" alt="..." />
        </div>
        {/* Add more carousel items similarly */}
        {/* ... */}
      </div>
      <button className="carousel-control-prev" type="button" data-bs-target="#carouselExample" data-bs-slide="prev">
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Previous</span>
      </button>
      <button className="carousel-control-next" type="button" data-bs-target="#carouselExample" data-bs-slide="next">
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Next</span>
      </button>
    </div>
  );
};

const ProductList = ({ products }) => {
  return (
    <div className="container">
      <div className="row g-4">
        {products.map(product => (
          <div className="col-md-4" key={product.id}>
            <div className="card">
              <img src={product.image} className="card-img-top" alt={product.title} />
              <div className="card-body">
                <h5 className="card-title">{product.title}</h5>
                <h5>{product.price}</h5>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

const Footer = () => {
  return (
    <footer className="bg-danger text-white py-5">
      <div className="container">
        <div className="row">
          <div className="col-md-4">
            <h5>Find us on</h5>
            <p>Zouk is a Modern Indian Lifestyle Brand for Bags, Luggage, Wallets & Footwear.</p>
            {/* Add email and social media links here */}
            {/* ... */}
          </div>
          {/* Add other columns for Useful Links and Newsletter similarly */}
        </div>
      </div>
    </footer>
  );
};

import 'bootstrap/dist/js/bootstrap.bundle.min.js';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
